import React from 'react';
import { Link } from 'react-router-dom';

function HomePage() {
    return (
        <div style={{ textAlign: 'center', padding: '20px' }}>
            <h1>Transcript Manager</h1>
            <p>Welcome to the Transcript Manager! Choose a feature to get started:</p>
            <div style={{ margin: '20px 0' }}>
                <Link to="/upload">
                    <button style={{ marginRight: '10px', padding: '10px 20px' }}>Upload Transcript</button>
                </Link>
                <Link to="/query">
                    <button style={{ padding: '10px 20px' }}>Query and Download</button>
                </Link>
            </div>
        </div>
    );
}

export default HomePage;
